import { Injectable } from '@nestjs/common';
import { mail } from '../../configs/env';
import { MailerService } from '@nestjs-modules/mailer';


interface mailerProps {
    to: string
    subject: string
    text: string,
    name: string
}

@Injectable()
export class MailService {

    constructor(
        private readonly mailerService: MailerService
    ) { }
    async createAccount(data: mailerProps) {

        const _html = `
        <div>
  <div style="text-align:center; background-color: green; padding: 20px">
    <p style="font-weight: bold;">Bem vindo ao CooperFlow</p>
    <span>Segue abaixo as informações para você efetuar o primeiro acesso.</span>
  </div>
  <div style="padding: 20px">
    <div>
      <span>Nome: ${ data.name }</span>
    </div>
    <div>
      <span>Usuário: ${ data.to }</span>
    </div>
    <div>
      <span>Acesse: </span>
    </div>
    <div style="display: flex; justify-content: center; padding: 20px; background-color: white">
      <img src="data:image/png;base64,${this.base_64}" alt="" style="height: 100px;">
    </div>
  </div>
</div>
`

        try {
            const response = this.mailerService.sendMail({
                to: data.to,
                from: 'noreplycooperflow@gmail.com',
                subject: data.subject,
                text: data.text,
                html: _html
            })
                .then(() => {
                    return response
                })
                .catch(() => {
                    return response
                });
        } catch (error) {

        }

    }

    public base_64 = ""
}
